import React, { useEffect, useState } from "react";
import NavbarAdmin from "./NavbarAdmin";
import axios from "axios";
const AdminViewOrders = () => {
    const [orderList, setOrderList] = useState([]);
    useEffect(() => {
        const fetchData = async () => {
            const res = await axios.get("http://localhost:5000/getOrderData");
            setOrderList(res.data);
        };
        fetchData();
    }, [])

    useEffect(() => {
        console.log(orderList);

    }, [orderList])
    return (
        <>
            <NavbarAdmin></NavbarAdmin>
            {orderList.map((e) => {
                return (
                    <div className="container-fluid p-3 " key={e._id}>

                        <div className="row m-2">
                            <div className="col-3"><h5>Name:{e.customerName}</h5></div>
                            <div className="col-3">Table Number:{e.tableNumber}</div>
                            <div className="col-3">Total Amount:{e.totalAmount}</div>
                        </div>
                        <div className="row m-2">
                            <div className="col-3">
                                <h4>        FoodName</h4>
                            </div>
                            <div className="col-3">
                                <h4>    FoodPrice </h4>
                            </div>
                        </div>
                        {e.cartItems.map((p) => {
                            return (<div className="row m-2">
                                <div className="col-3">
                                    {p.name}
                                </div>
                                <div className="col-3">
                                    {p.price}
                                </div>
                            </div>);
                        })}
                        <div className="row">
                            <div className="col-3"></div>
                            <div className="col-3">
                                <button className="btn btn-primary">Finished Cooking</button>
                            </div>
                        </div>

                    </div>);
            })}
        </>
    );
};

export default AdminViewOrders;
